    "tooltip_cloudUrl": {                            "en": "Normally you do not need to change it. Only required if you plan to use your own cloud.", "de": "Normalerweise muss diese Option nicht geändert werden. Dies ist nur notwendig, wenn man eigenen Cloud verwendet.", "ru": "Обычно не нужно менять этот параметр. Только если используется собственное облако.", "pt": "Normalmente, você não precisa mudá-lo. Só é necessário se você planeja usar sua própria nuvem.", "nl": "Normaal gesproken hoeft u dit niet te veranderen. Alleen vereist als u van plan bent uw eigen cloud te gebruiken.", "fr": "Normalement, vous n'avez pas besoin de le changer. Uniquement nécessaire si vous prévoyez d'utiliser votre propre cloud.", "it": "Normalmente non è necessario cambiarlo. Richiesto solo se prevedi di utilizzare il tuo cloud.", "es": "Normalmente no es necesario cambiarlo. Solo es obligatorio si planea usar su propia nube.", "pl": "Zwykle nie musisz tego zmieniać. Wymagane tylko, jeśli masz zamiar korzystać z własnej chmury."},
    "tooltip_concatWord": {                          "en": "Define how to concatenate Room and Function. E.g. with 'in': Light in living room.", "de": "Damit wird definiert wie Funktion und Raum miteinander verbunden werden; z.B. mit 'im': Licht im Schlafzimmer", "ru": "Можно указать каким словом соединять Функцию и Комнату. Например с 'в': Свет в зале.", "pt": "Defina como concatenar o Quarto e a Função. Por exemplo. com 'in': luz na sala de estar.", "nl": "Bepaal hoe kamer en functie moeten worden samengevoegd. Bijv. met 'in': licht in de woonkamer.", "fr": "Définir la concaténation de la pièce et de la fonction. Par exemple. avec 'in': Lumière dans le salon.", "it": "Definire come concatenare Room e Function. Per esempio. con 'in': luce nel soggiorno.", "es": "Definir cómo concatenar Habitación y Función. P.ej. con 'en': luz en la sala de estar.", "pl": "Określ, jak połączyć pokój i funkcję. Na przykład. z \"in\": Światło w salonie."},
    "tooltip_deviceOffLevel": {                      "en": "Some groups consist of mixed devices: dimmers and switches. It is allowed to control them with ON and OFF commands and with percents", "de": "Gruppen können aus gemischten Geräten (Schaltern und Dimmern) bestehen. Sie können mit ON/OFF sowie Prozentwerten angesteuert werden, hier kann definiert werden welcher Prozentsatz OFF entspricht.", "ru": "Некоторые группы состоят из смешанных устройств: диммеров и переключателей. Разрешено управлять ими с помощью команд ON и OFF и с процентами", "pt": "Alguns grupos consistem em dispositivos mistos: dimmers e switches. É permitido controlá-los com comandos ON e OFF e com porcentagens", "nl": "Sommige groepen bestaan ​​uit gemengde apparaten: dimmers en schakelaars. Het is toegestaan ​​om ze te besturen met AAN- en UIT-commando's en met percentages", "fr": "Certains groupes sont composés de dispositifs mixtes: gradateurs et commutateurs. Il est permis de les contrôler avec des commandes ON et OFF et avec des pourcentages", "it": "Alcuni gruppi sono costituiti da dispositivi misti: dimmer e interruttori. È consentito controllarli con comandi ON e OFF e con percentuali", "es": "Algunos grupos consisten en dispositivos mixtos: atenuadores e interruptores. Se permite controlarlos con comandos ON y OFF y con porcentajes", "pl": "Niektóre grupy składają się z różnych urządzeń: ściemniaczy i przełączników. Dozwolone jest sterowanie nimi za pomocą poleceń ON i OFF oraz procentami"},
    "tooltip_functionFirst": {                       "en": "Normally the names looks like room_function. Here you can switch it to function_room.", "de": "Die automatischen Namen werden im Schema Raum-Funktion generiert. Hiermit kann man es auf Funktion-Raum geändert werden.", "ru": "Обычно имена выглядят как Комната-Функция. Этой настройкой можно переключить на Функция-Комната.", "pt": "Normalmente, os nomes parecem room_function. Aqui pode mudar para function_room.", "nl": "Normaal gezien zien de namen eruit als room_function. Hier kun je het omschakelen naar function_room.", "fr": "Normalement, les noms ressemblent à room_function. Ici vous pouvez passer à function_room.", "it": "Normalmente i nomi assomigliano a room_function. Qui puoi passare a function_room.", "es": "Normalmente los nombres parecen room_function. Aquí puedes cambiarlo a function_room.", "pl": "Normalnie nazwy wyglądają jak room_function. Tutaj możesz przełączyć go do function_room."},
