    "tooltip_restartOnDisconnect": {                 "en": "Workaround for missing connection to Alexa after the connection to cloud was lost. With this option you can restart adapter after each disconnection and it will work.", "de": "Workaround für fehlende Kommunikation mit Alexa nach Verbindungsabbruch. Damit kann man zwingen den Adapter neu zu starten und das Problem umgehen.", "ru": "Временное решение для проблемы с пропажей соединения с Alexa, после воссоединения с облаком. Этим можно перестартовать драйвер после потери соединения.", "pt": "Solução de problemas por conexão perdida com Alexa após a conexão à nuvem ter sido perdida. Com esta opção, você pode reiniciar o adaptador após cada desconexão e funcionará.", "nl": "Oplossing voor ontbrekende verbinding met Alexa nadat de verbinding met de cloud verloren was gegaan. Met deze optie kunt u de adapter opnieuw opstarten na elke verbreking en het zal werken.", "fr": "Solution de contournement pour la connexion manquante à Alexa après la connexion au cloud a été perdue. Avec cette option, vous pouvez redémarrer l'adaptateur après chaque déconnexion et cela fonctionnera.", "it": "Soluzione alternativa per la mancata connessione ad Alexa dopo la perdita della connessione al cloud. Con questa opzione è possibile riavviare l'adattatore dopo ogni disconnessione e funzionerà.", "es": "Solución alternativa para la conexión faltante a Alexa después de la conexión a la nube se perdió. Con esta opción, puede reiniciar el adaptador después de cada desconexión y funcionará.", "pl": "Rozwiązano problem braku połączenia z Alexa po utracie połączenia z chmurą. Dzięki tej opcji można ponownie uruchomić adapter po każdym rozłączeniu i będzie działać."},
